import React from 'react';


const IdentitySection = ({ firstName, lastName, email, handleInputChange }) => {
  return (
    <>
    <div className="row">
      <input
      name="firstName"
      placeholder="First"
      required
      value={firstName}
      onChange={handleInputChange}
      />
      <input
      name="lastName"
      placeholder="Last"
      required
      value={lastName}
      onChange={handleInputChange}
      />
    </div>
    <div className="row">
      <input
      name="email"
      placeholder="email"
      required
      value={email}
      onChange={handleInputChange}
      />
    </div>
    </>
  )
}

export default IdentitySection;
